import { Page, TextStyle } from "@shopify/polaris";

const Index = () => (
  <div>
    <Page>
      <TextStyle variation="positive">
        <p>Sample app using React and Next.js</p>
      </TextStyle>
    </Page>
  </div>
);

export default Index;
